  [],\n\t\"num_tags\": 3,\n\t\"name\": \"non-toxic-ionic-liquid-fuels-for-exploration-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Challenges arise in the propulsion systems
  for the new exploration architecture.  The currently operational and proven storable
  hypergolic systems raise toxicity concerns.  Because MMH is a carcinogen, measures
  must be taken to prevent exposure of personnel to the fuel from the time of its
  synthesis to the time of it neutralization.  This extra care translates into increased
  expense for the mission.  Replacing the MMH in the propulsion systems with an equally
  energetic, sasfer fuel would considerably reduce risk and cost on exploration missions.
  \ Ionic liquids offer promising candidates for dense, energetic, and safe rocket
  fuels.  In the proposed work ORBITEC will demonstrate the feasibility of developing
  hypergolic ionic liquid fuels for propulsion systems used in the Exploration architecture.
  \ We will develop one set hypergolic with a storable oxidizer, nitrogen tetroxide
  (NTO) and one set hypergolic with a cryogenic oxidizer, liquid oxygen (LOX).  We
  will test the hypergolicity and the material properties.  The resulting sets of
  propellants will be ready for performance testing early in the Phase II work to
  enable achieving a technical readiness level (TRL) of 5 by the end of the Phase
  II work.  \",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
